import React from 'react';
import PropTypes from 'prop-types';

const StockItem = ({stock}) => {
  return (
    <div className='stock-card'>
      <h5></h5>
    </div>
  );
};

StockItem.propTypes = {
  stock: PropTypes.object.isRequired
};

export default StockItem;
